	(14319400,'mdp.39015018627060','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<record xmlns=\"http://www.loc.gov/MARC21/slim\">\n  <leader>02754nam a22003017  4500</leader>\n  <controlfield tag=\"001\">mdp.39015018627060</controlfield>\n  <controlfield tag=\"003\">MiAaHDL</controlfield>\n  <controlfield tag=\"005\">20130211000000.0</controlfield>\n  <controlfield tag=\"006\">m        d        </controlfield>\n  <controlfield tag=\"007\">cr bn ---auaua</controlfield>\n  <controlfield tag=\"007\">hd|afb|||baca</controlfield>\n  <controlfield tag=\"008\">920330c19901990miu|||| |b||| 00|00|eng d</controlfield>\n  <datafield tag=\"035\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">(MiU)003914058</subfield>\n  </datafield>\n  <datafield tag=\"035\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">sdr-miu003914058</subfield>\n  </datafield>\n  <datafield tag=\"035\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">(OCoLC)68792584</subfield>\n  </datafield>\n  <datafield tag=\"035\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">(UMI)09023507</subfield>\n  </datafield>\n  <datafield tag=\"040\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">UMI</subfield>\n    <subfield code=\"c\">UMI</subfield>\n    <subfield code=\"d\">MiU</subfield>\n  </datafield>\n  <datafield tag=\"099\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">UMI diss--UM</subfield>\n  </datafield>\n  <datafield tag=\"100\" ind1=\"1\" ind2=\" \">\n    <subfield code=\"a\">AMINI, AMIR ARSHAM</subfield>\n  </datafield>\n  <datafield tag=\"245\" ind1=\"1\" ind2=\"0\">\n    <subfield code=\"a\">USING DYNAMIC PROGRAMMING FOR SOLVING VARIATIONAL PROBLEMS IN VISION: APPLICATIONS INVOLVING DEFORMABLE MODELS FOR CONTOURS AND SURFACES.</subfield>\n  </datafield>\n  <datafield tag=\"260\" ind1=\" \" ind2=\" \">\n    <subfield code=\"c\">1990, c1990.</subfield>\n  </datafield>\n  <datafield tag=\"300\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">174 p.</subfield>\n  </datafield>\n  <datafield tag=\"500\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">CO-CHAIRS: TERRY E. WEYMOUTH; DAVID J. ANDERSON</subfield>\n  </datafield>\n  <datafield tag=\"502\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">DISSERTATION (PH.D.)--THE UNIVERSITY OF MICHIGAN</subfield>\n  </datafield>\n  <datafield tag=\"510\" ind1=\"4\" ind2=\" \">\n    <subfield code=\"a\">Dissertation Abstracts International,</subfield>\n    <subfield code=\"c\">51-04B, p. 1973, AAF9023507</subfield>\n  </datafield>\n  <datafield tag=\"520\" ind1=\"8\" ind2=\" \">\n    <subfield code=\"a\">network of nodes is reconstructed using the output of the first stage of the algorithm as hard constraints in the reconstruction. Within this framework, the set of admissible surfaces is created with deformable signals. A possible method for parallel implementation of dynamic programming applicable to both contours and surfaces is also discussed.</subfield>\n  </datafield>\n  <datafield tag=\"520\" ind1=\"8\" ind2=\" \">\n    <subfield code=\"a\">Extension of dynamic programming to two dimensions is discussed. Based on the extension of the theory to two dimensions, a discrete algorithm for reconstruction of surfaces from stereo disparities is developed. Discontinuity preserving surface reconstruction is accomplished in two stages. In the first stage, using an extension of an algorithm due to Blake, local discontinuities in sparse depth data are located. In the second stage, the minimal energy surface which corresponds to the shortest route in a</subfield>\n  </datafield>\n  <datafield tag=\"520\" ind1=\"8\" ind2=\" \">\n    <subfield code=\"a\">applicability of the inflating/deflating contour algorithm.</subfield>\n  </datafield>\n  <datafield tag=\"520\" ind1=\"8\" ind2=\" \">\n    <subfield code=\"a\">A new class of deformable contours is described. These contours, dubbed inflating/deflating contours have the capability of growing or shrinking and thus attaching to object boundaries from the inside or attaching to object boundaries from the outside. The dynamic programming formulation leads to a stable behavior for the contours over iterations, in addition to allowing for hard constraints to be enforced on the behavior of the solution. We illustrate experimental results in order to quantify the</subfield>\n  </datafield>\n  <datafield tag=\"520\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">Two separate vision problems are considered in this thesis. The problem of extracting image contours, and the problem of reconstruction of surfaces from stereo disparities. The central concepts in this study are dynamic programming, and deformable models. For both contour extraction and surface reconstruction, appropriate deformable models are introduced, and the models are optimized using dynamic programming.</subfield>\n  </datafield>\n  <datafield tag=\"538\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">Mode of access: Internet.</subfield>\n  </datafield>\n  <datafield tag=\"650\" ind1=\" \" ind2=\"4\">\n    <subfield code=\"a\">ENGINEERING, ELECTRONICS AND ELECTRICAL</subfield>\n  </datafield>\n  <datafield tag=\"CID\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">003914058</subfield>\n  </datafield>\n  <datafield tag=\"DAT\" ind1=\"0\" ind2=\" \">\n    <subfield code=\"a\">20130211144936.0</subfield>\n    <subfield code=\"b\">20130211000000.0</subfield>\n  </datafield>\n  <datafield tag=\"DAT\" ind1=\"1\" ind2=\" \">\n    <subfield code=\"a\">20130215200928.0</subfield>\n    <subfield code=\"b\">2013-08-15T14:01:19Z</subfield>\n  </datafield>\n  <datafield tag=\"CAT\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">SDR-MIU</subfield>\n    <subfield code=\"d\">EX LIBRIS - ALEPH</subfield>\n    <subfield code=\"l\">loader.pl-002-002</subfield>\n  </datafield>\n  <datafield tag=\"FMT\" ind1=\" \" ind2=\" \">\n    <subfield code=\"a\">BK</subfield>\n  </datafield>\n  <datafield tag=\"HOL\" ind1=\" \" ind2=\" \">\n    <subfield code=\"0\">sdr-miu003914058</subfield>\n    <subfield code